data.descripcion:
Mug recto de 350ml, confeccionado en PP y Wheat Straw, pasta de caña (paja) de trigo, un material sustentable que reduce la huella de Carbono en nuestro planeta. Producto libre de BPA.
&nbsp;
IMPORTANTE: oferta hasta el 30 de Septiembre de 2025.

Elegante Trofeo modelo "Lonely Star", base de madera barnizada y estrella de cristal en su parte superior. Presentación en caja de cartón forrado negro con cierre imantado, interior acolchado de espuma y tela poliéster satinado negro, con troquel.
&nbsp;
IMPORTANTE: oferta hasta el 30 de noviembre de 2025.

Bolígrafo ecológico de madera de Bamboo, modelo "EVA". Con terminales metálicos y sección superior en goma EVA de color. Tinta azul.
&nbsp;
IMPORTANTE: oferta hasta el 30 de noviembre de 2025.

Elegante Trofeo modelo "Biondi", base de cristal negro y estrella de cristal en su parte superior. Presentación en caja de cartón forrado negro con cierre imantado, interior acolchado de espuma y tela poliéster satinado negro, con troquel.
&nbsp;
IMPORTANTE: oferta hasta el 30 de noviembre de 2025.

Imán (magneto) cuadrado con puntas redondeadas de 5 x 5 cm, para Sublimación. Ideal para Refrigerador.
&nbsp;
IMPORTANTE: Recuerde que todas las máquinas para sublimar son diferentes y requieren distintos tiempos y temperaturas. Así mismo los productos varían según el fabricante. Antes de sublimar una partida completa, siempre debe hacer pruebas sobre muestras hasta que logre ajustar su máquina para obtener la óptima intensidad del color y no quemar el producto o dejarlo deslavado.
